import React, { useEffect, useState } from "react";
import axios from "axios";

import './style.scss'
import { Button, Card,CardImg, CardBody, CardTitle, CardText } from "reactstrap";
import Navbar from "../../navbar";
import RightSidebar from "../../right-sidebar";
// import Headline from "../../carousel";

export default function NewsPage() {
    const [data, setData] = useState([]);
    const getData = () => {
        setData([{id:"1", logo: "data:image/png;base64,",
         name: "arsenal"},
                {id:"2", logo: "data:image/png;base64,",
                 name: "aston villa"},
                {id:"3", logo: "data:image/png;base64,",
                 name: "brentford"},
                {id:"4", logo: "data:image/png;base64,",
                 name: "brighton & hove albion"},
                {id:"5", logo: "data:image/jpeg;base64,",
                 name: "burnley"},
                {id:"6", logo: "data:image/png;base64,",
                 name: "chelsea"},
                {id:"7", logo: "data:image/png;base64,",
                 name: "crystal palace"},
                {id:"8", logo: "data:image/png;base64,",
                 name: "everton"},
                {id:"9", logo: "data:image/png;base64,",
                 name: "leeds united"},
                {id:"10", logo: "",
                 name: "leicester city"},
                {id:"11", logo: "",
                 name: "liverpool"},
                {id:"12", logo: "",
                 name: "manchester city"},
                {id:"13", logo: "",
                 name: "manchester united"},
                {id:"14", logo: "",
                 name: "newcastle united"},
                {id:"15", logo: "",
                 name: "norwich city"},
                {id:"16", logo: "",
                 name: "southampton"},
                {id:"17", logo: "",
                 name: "tottenham hotspurs"},
                {id:"18", logo: "",
                 name: "watford"},
                {id:"19", logo: "",
                 name: "west ham united"},
                {id:"20", logo: "",
                 name: "wolverhampton wanderers"},
            ])
    };
    // const getData = async () => {
    //     const response = await axios.get('http://localhost:5000/club')
    //         setData(response.data);
    // };
    
    useEffect(() => {
        getData();
    }, []);
    return(
        <>
            < Navbar />
            <div className="catalog-body">
                <div className="col">
                    {data.map((d) => (
                        <div className="row bariss">
                            <div className="col-md-10" key={d.id}>
                                <Card className="col-md-10 body-card">
                                    <CardBody>
                                        <CardImg className="card-img" src={`${d.logo}`} alt="Card image cap" />
                                        <CardTitle className="card-title">{d.name}</CardTitle>
                                        <CardText className="card-desc">berita tentang {d.name}</CardText>
                                        <Button size="sm">Selengkapnya</Button>
                                    </CardBody>
                                </Card>
                            </div>
                        </div>
                    ))}
                </div>
                <div className="col">
                    {data.map((d) => (
                        <div className="row">
                            <div className="col-md-2" key={d.id}>
                                <Card className="col-md-2 body-card">
                                    <CardBody>
                                        <CardImg className="card-img" src={`${d.logo}`} alt="Card image cap" />
                                        <CardTitle className="card-title">{d.name}</CardTitle>
                                        <CardText className="card-desc">berita tentang {d.name}</CardText>
                                        <Button size="sm">Selengkapnya</Button>
                                    </CardBody>
                                </Card>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </>
    )
}
